import "./Admin.css";
import Tabs from "../../components/tabs/Tabs";


class Admin extends Component {
    render() {
        return (
            <Tabs>
                <div label="Home Page" >
                    <div className="content">

                    </div>
                </div>
                <div label="Inprogress">
                    <div className="content">

                    </div>
                </div>
                <div label="Completed">
                    <div className="content">

                    </div>
                </div>
            </Tabs>
        );
    }
}

export default Admin;
